import { FC, useContext, useState, useEffect } from 'react';
import logo from '../assets/logo.png';
import api from '../api/axiosConfig';
import { Button, Typography } from '@mui/material';
import { RecipeInfo } from '../types/recipe';

const Home: FC = () => {
  const [desserts, setDesserts] = useState<RecipeInfo[]>([]);
  async function fetchAll() {
    console.log('fetching');
    const result = await api.get('/all');
    console.log(result);
    setDesserts(result.data);
  }

  /* manage side effects */
  useEffect(() => {
    (async () => await fetchAll())();
  }, []);

  return (
    <>
      <Button variant="contained" onClick={fetchAll}>
        Fetch Dessert
      </Button>
      {desserts.map((dessert) => (
        <p>{dessert.title}</p>
      ))}
      <Typography variant="h2">CMAOYT Home sweet home</Typography>{' '}
      <img alt="CMAOYT logo" src={logo} />
    </>
  );
};

export default Home;
